import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import SignUpForm from "./SignUp";

export default function BasicExample() {
  return (
    <Router>
      <div>
        <ul>
        <li><Link to = "/"> SignUp </Link>
         </li>
         <hr/>
         </ul>
      <Switch>
        <Route exact path = "/">
          <SignUpForm/>
        </Route>
        </Switch>
        </div>
        </Router>);
      }

      function SignUp() {
        return (<div><h2> SignUp</h2></div>
        );
      }
